import React from 'react';
import { NavLink } from 'react-router-dom';


const Footer =(() => {
    return(
        <>
        <footer className="w-100 text-center bg-light footer">
            <p className="py-2">©️ 2020-2021 <strong className="text-primary"><a href="https://sulphitic786.github.io/portfolio/" className="text"></a> SulphiticCo. </strong> <br />All Rights Reserved | Terms and Conditions Resserved.  </p>
        </footer>
    </>
    )
});


export default Footer;
